window.addEventListener("load",(function(){const e=document.getElementById("header__hamburger-main"),d=document.getElementById("header__hamburger-sub"),a=document.getElementById("mobile-menu");e.addEventListener("click",()=>{e.classList.add("header_hide-hamburger"),a.classList.add("header__menu_active")}),d.addEventListener("click",()=>{e.classList.remove("header_hide-hamburger"),a.classList.remove("header__menu_active")})}));